              <th>Amount</th>
              <th>Timestamp</th>
            </tr>
          </thead>
          <tbody>
            {filteredTransactions.map((tx, index) => (
              <tr key={index}>
                <td>{tx.userId === 'admin' ? 'Admin' : tx.userId}</td>
                <td>{tx.type === 'Admin Sell Stock' ? 'Sold' : tx.type}</td>
                {/* ... rest of the table content remains the same ... */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  )
}

export default Observer
